import First from "./first";
import Full from "./full";
import Image from "./image";
import Info from "./info";
import Navbar from "./navbar";
import Rating from "./rating";
import "./front.css"
import Collection from "./image-collection";
function Main(){
    return(
        <div>
            <Navbar></Navbar>
            <First></First>
            <Rating></Rating>
            <Info></Info>
            <Full></Full>
            <Collection></Collection>
        </div>
    )
}
export default Main;
